import React, {Component} from 'react';
import logo from './drawable/logo.svg'


class Navigation extends Component {

    render() {
        return (
            <div>
                <ul>
                    <li><img src={logo}></img></li>
                    <li><input type="text"/></li>
                    <li></li>
                </ul>

            </div>
        );
    }
}

export default Navigation;
